import { Card, Avatar, Button } from "antd";
// import {}

const ProfileCard = () => {
  const dummy = {
    pet: {
      name: "wilson",
      breed: "golden reetriver",
      age: 2,
      location: "경기도 성남시 분당구",
      image: "http://www.animaltogether.com/news/photo/201907/167_346_855.jpg",
    },
    owner: { name: "kk" },
  };
  return (
    <Card title={dummy.pet.name} actions={[]} cover={<img src={dummy.pet.image} />}>
      <Card.Meta
        avatar={<Avatar src={dummy.pet.image} />}
        title="Card title"
        description={
          <ul>
            <li>{dummy.pet.breed}</li>
            <li>{dummy.pet.age}</li>
            <li>{dummy.pet.location}</li>
          </ul>
        }
      />
    </Card>
  );
};

export default ProfileCard;
